// Get the URL from the clipboard
var url = TextExpander.pasteboardText;

// Find the last group of digits in the URL
var regex = /\d+$/;
var match = url.match(regex);

// If a match is found, copy "ticket" and the matched numbers to the clipboard
if (match) {
  TextExpander.appendOutput("Ticket " + match[0]);
}

// Get the URL from the clipboard
var url = TextExpander.pasteboardText;

// Find the last group of digits in the URL
var regex = /\d+$/;
var match = url.match(regex);

// If a match is found, create a hyperlink with the original URL and the matched numbers
if (match) {
  var output = "[Ticket " + match[0] + "](" + url + ")";
  TextExpander.appendOutput(output);
}
